import React from "react";
import axios from "axios";

import Layout from "../../components/Layout";

const Host = () => {
  const hostings = axios
    .get("http://localhost:1337/hostings")
    .then((data) => console.log(data));

  return <Layout>Host</Layout>;
};

export default Host;
